import React from 'react';
import './CheckBx.scss';
import tick from "../../../images/tick.png";
import ImgBx from '../../ImgBx/ImgBx';

function CheckBx() {
    return (
        <div className='CheckBx'>
            <ImgBx img={tick} />
        </div>
    )
}

export default CheckBx
